function loadTable(t){var a,e="";for(a=0;a<t.length;a++)e+="<tr><td>"+t[a].name+"</td><td>"+t[a].start+"</td><td>"+t[a].end+"</td></tr>";$("#display").html(e),$("#pre").hide(),$("#main").show()}$("#load").click(function(){var t=$("#data").val(),a=JSON.parse(t);if("static"===a.type)loadTable(a.times);else if("oddEven"===a.type){var e=(new Date).getDay()%2;loadTable(a.times[e])}});
